vsync = false;function love.conf(t)    t.title = "Luizsan testing shit"     t.author = "luizsan"    t.url = nil      t.identity = "save"            -- The name of the save directory (string)    t.version = "0.8.0"         -- The LÖVE version this game was made for (string)    t.release = false           -- Enable release mode (boolean)    t.screen.width = 640        -- The window width (number)    t.screen.height = 480       -- The window height (number)    t.screen.fullscreen = false -- Enable fullscreen (boolean)    t.screen.vsync = vsync      -- Enable vertical sync (boolean)end